import React from 'react';

const Notmatching=()=>{
    return (
        <>
          <div>
            <h1>
              {x}
              {y}
              {z}
            </h1>
            <h1>this is Not Matching</h1>
            <hr />
          </div>
        </>
      );
}
export default Notmatching;
